import { useState } from "react";
import HomePage from "./routes/Home";
import GamePage from "./routes/Game";
import { Route, Switch } from "re";

const App = () => {
  <Switch>
    <Route path="/home" component={HomePage} />
  </Switch>;
};

export default App;
